import { useState, useEffect } from 'react';
import { useNavigate } from 'react-router-dom';
import './InstructorProfile.css';

const InstructorProfile = () => {
  const navigate = useNavigate();
  const [instructorData, setInstructorData] = useState({
    fullName: '',
    email: '',
    age: '',
    experience: '',
    vehicleInfo: null,
    hourlyRate: 0,
    availability: true,
    packages: []
  });

  // Load instructor data
  useEffect(() => {
    const storedData = JSON.parse(localStorage.getItem('instructorData')) || {
      fullName: 'sauleh',
      email: 't221132@nu.edu.pk',
      age: '18',
      experience: 'Not specified',
      hourlyRate: 0,
      availability: true
    };
    setInstructorData(storedData);
  }, []);

  const handleEditProfile = () => navigate('/instructor/edit-profile');
  const handleAddVehicle = () => navigate('/instructor/add-vehicle');
  const handleEditPricing = () => navigate('/instructor/edit-pricing');
  const toggleAvailability = () => {
    setInstructorData(prev => ({
      ...prev,
      availability: !prev.availability
    }));
  };

  return (
    <div className="instructor-profile-container">
      {/* Sidebar */}
      <div className="sidebar">
        <h2 className="sidebar-title">DriveMaster</h2>
        <ul className="sidebar-menu">
          <li className="active">My Profile</li>
          <li onClick={() => navigate('/instructor/manage-lessons')}>Manage Lessons</li>
          <li onClick={() => navigate('/instructor/booking-requests')}>Booking Requests</li>
          <li onClick={() => navigate('/instructor/availability')}>Availability</li>
          <li onClick={() => navigate('/instructor/ratings')}>Ratings</li>
          <li onClick={() => navigate('/instructor/earnings')}>Earnings</li>
        </ul>
      </div>

      {/* Main Content */}
      <div className="profile-content">
        <h1 className="profile-header">Instructor Profile</h1>
        <p className="profile-subheader">Manage your instructor information</p>

        {/* Personal Information Section */}
        <div className="profile-section">
          <h2 className="section-title">Personal Information</h2>
          <div className="info-grid">
            <div className="info-row">
              <div className="info-label">Full Name</div>
              <div className="info-value">{instructorData.fullName}</div>
            </div>
            <div className="info-row">
              <div className="info-label">Age</div>
              <div className="info-value">{instructorData.age}</div>
            </div>
            <div className="info-row">
              <div className="info-label">Email Address</div>
              <div className="info-value">{instructorData.email}</div>
            </div>
            <div className="info-row">
              <div className="info-label">Experience</div>
              <div className="info-value">{instructorData.experience}</div>
            </div>
          </div>
        </div>

        {/* Vehicle Information Section */}
        <div className="profile-section">
          <h2 className="section-title">Vehicle Information</h2>
          {instructorData.vehicleInfo ? (
            <div className="vehicle-details">
              {/* Display vehicle details here when available */}
            </div>
          ) : (
            <p className="no-vehicle">No vehicle information added yet.</p>
          )}
        </div>

        {/* Pricing & Availability Section */}
        <div className="profile-section">
          <h2 className="section-title">Pricing & Availability</h2>
          <div className="info-grid">
            <div className="info-row">
              <div className="info-label">Hourly Rate</div>
              <div className="info-value">₹{instructorData.hourlyRate} per hour</div>
            </div>
            <div className="info-row">
              <div className="info-label">Current Availability Status:</div>
              <div className="info-value">
                {instructorData.availability ? 'Available for Bookings' : 'Unavailable'}
              </div>
            </div>
          </div>
          <button 
            className={`availability-toggle ${instructorData.availability ? 'unavailable' : 'available'}`}
            onClick={toggleAvailability}
          >
            Set as {instructorData.availability ? 'Unavailable' : 'Available'}
          </button>
        </div>

        {/* Package Deals Section */}
        <div className="profile-section">
          <h2 className="section-title">Package Deals</h2>
          {instructorData.packages.length > 0 ? (
            <div className="package-list">
              {/* Display packages here when available */}
            </div>
          ) : (
            <p className="no-packages">No package deals configured</p>
          )}
        </div>

        {/* Action Buttons */}
        <div className="action-buttons">
          <button className="edit-btn" onClick={handleEditProfile}>Edit Profile</button>
          <button className="add-vehicle-btn" onClick={handleAddVehicle}>Add Vehicle</button>
          <button className="pricing-btn" onClick={handleEditPricing}>Edit Pricing</button>
        </div>
      </div>
    </div>
  );
};

export default InstructorProfile;
